description:
Almoço (das 12 às 15) e jantar (das 19:30 às 22) de terça a sexta;
Mínimo 10 pessoas;
Rodízio de pizzas, doces e salgadas ou grelhados mistos à descrição;
Inclui 1 sangria tinta ou branca a cada 3 pessoas, ou 3 sumos 0,33cl, imperial, água e 1 café por pessoa;
As pizzas podem ter até 3 sabores, o tamanho da pizza é 30cm;
O desperdício tem o custo de 19,99€/kg

